          }

        const getLotr = async () => {
            let data = await fetch('https://the-one-api.dev/v2/book')
            let lotr = await data.json()
            setLotr(lotr)
        }

        getLotr()
    }, [])

    return (
      <>
        <p>test</p>
        {lotr.map(lotr => <li>{lotr.name}</li>)}
      </>
    )
}

export default App;
